export default class CreatePool extends Component {
  render() {
    return (
      <div>
        <div className="create">
          <div className="create__to">
            <div>
              <input value="Eaton Center"></input>
              <input value="Waterloo University">Waterloo University</input>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
